def index_binary_search_left(array, x):

    if len(array) == 0:
        return -1
    first = 0
    last = len(array) - 1

    while first <= last:
        index = (first + last) // 2
        if array[index] == x:
            return index
        else:
            if x < array[index]:
                last = index - 1
            else:
                first = index + 1
    if array[index] > x:
        return index - 1
    else:
        return index

