def flip_bbox(bbox, image_shape, hflip=False, vflip=False):

    try:
        h, w = image_shape
    except TypeError:
        h = image_shape
        w = image_shape

    if hflip:
        bbox[..., :2] = (w - bbox[..., : 2])[..., ::-1]

    if vflip:
        bbox[..., 2:4] = (h - bbox[..., 2:4])[..., ::-1]

    return bbox

