def kronecker_addmm(mat1, mat2, mat3, bias=None, alpha=1.0, beta=1.0):

    res = mat1 @ mat3 @ mat2
    res.mul_(alpha)
    if bias is not None:
        res.add_(beta, bias)
    return res

