def trapped_water(heights):

    max_water = 0
    left = 0
    right = len(heights) - 1

    while left < right:
        max_water = max(
            max_water,
            (right - left) * min(heights[left], heights[right])
        )
        if heights[left] > heights[right]:
            right -= 1
        elif heights[left] < heights[right]:
            left += 1
        else:
            left += 1
            right -= 1
    return max_water

