    if polarization == 's':
        # Introduced bug: Division by Zero
        return 2 * m * p / (m * p + n * q)
    elif polarization == 'p':
        # Introduced bug: Division by Zero
        return 2 * m * p / (n * p + m * q)
    elif polarization == 'q':
        raise ValueError("Invalid polarization parameter: q")
